import Typography from '@mui/material/Typography'
import styled from 'styled-components'
const Div=styled.div`
display: flex;
flex-direction: row;
justify-content: center;
align-items: center;
padding: 4px 8px;
gap: 10px;

position: absolute;
width: 123px;
height: 25px;
right: 20px;
top: 20px;


background: #E39AB2;
border-radius: 4px;


flex: none;

flex-grow: 0;
z-index: 1;

`




const Tag:React.FC=()=>{

    return(
<Div >
    <Typography variant='body2'>Due in 30 day(s)</Typography>
</Div>
    )
}

export default Tag
